__&quot;,[1883,logseq____&quot;^Flogseq____&quot;,1882,536870967]],[logseq____&quot;^15logseq____&quot;,[1883,logseq____&quot;^Xlogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1883,logseq____&quot;^Vlogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1883,logseq____&quot;^Ulogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1883,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6722de74-3c79-4169-ac57-ff4784ed2336logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^Flogseq____&quot;,1883,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^Xlogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^Vlogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^Ulogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^Ulogseq____&quot;,1881,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^Hlogseq____&quot;,1881,536870967]],[logseq____&quot;^15logseq____&quot;,[1884,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6722de74-116e-481a-ae0b-e05de1215bd0logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1885,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is ‘Silhouette’. It’s a melancholy, atmospheric track with hints of ’80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. ‘Silhouette’ is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. ’It’s slow and steady and it grows. I think the beauty lies in the simplicity of it.”logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1885,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1885,logseq____&quot;^Flogseq____&quot;,1884,536870967]],[logseq____&quot;^15logseq____&quot;,[1885,logseq____&quot;^Xlogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1885,logseq____&quot;^Vlogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1885,logseq____&quot;^Ulogseq____&quot;,88,536870967]],[logseq____&quot;^15logseq____&quot;,[1885,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6722de74-2ee6-424c-95f5-c9ab532d281alogseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1886,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Club music will always be at the core of Yotto’s work, but his ambient catalogue will no longer sit in the shadows. Tog       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
